// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/**
 * @title DAOVoting
 * @dev DAO governance for AI signal validation
 */
contract DAOVoting {
    struct Proposal {
        uint256 id;
        uint256 signalId;
        string description;
        uint256 votesFor;
        uint256 votesAgainst;
        uint256 startTime;
        uint256 endTime;
        bool executed;
        address proposer;
        mapping(address => bool) hasVoted;
    }

    uint256 public proposalCount;
    uint256 public votingPeriod = 3 days;
    uint256 public minQuorum = 10; // Minimum votes needed

    mapping(uint256 => Proposal) public proposals;
    mapping(address => uint256) public votingPower;

    event ProposalCreated(
        uint256 indexed proposalId,
        uint256 signalId,
        string description,
        address proposer
    );

    event VoteCast(
        uint256 indexed proposalId,
        address voter,
        bool support,
        uint256 weight
    );

    event ProposalExecuted(uint256 indexed proposalId, bool approved);

    /**
     * @dev Create a new proposal for signal validation
     */
    function createProposal(
        uint256 _signalId,
        string memory _description
    ) external returns (uint256) {
        require(bytes(_description).length > 0, "Description required");

        proposalCount++;
        Proposal storage proposal = proposals[proposalCount];

        proposal.id = proposalCount;
        proposal.signalId = _signalId;
        proposal.description = _description;
        proposal.startTime = block.timestamp;
        proposal.endTime = block.timestamp + votingPeriod;
        proposal.proposer = msg.sender;

        emit ProposalCreated(
            proposalCount,
            _signalId,
            _description,
            msg.sender
        );

        return proposalCount;
    }

    /**
     * @dev Vote on a proposal
     */
    function vote(uint256 _proposalId, bool _support) external {
        Proposal storage proposal = proposals[_proposalId];

        require(block.timestamp < proposal.endTime, "Voting ended");
        require(!proposal.hasVoted[msg.sender], "Already voted");
        require(
            _proposalId > 0 && _proposalId <= proposalCount,
            "Invalid proposal"
        );

        uint256 weight = votingPower[msg.sender] > 0
            ? votingPower[msg.sender]
            : 1;

        proposal.hasVoted[msg.sender] = true;

        if (_support) {
            proposal.votesFor += weight;
        } else {
            proposal.votesAgainst += weight;
        }

        emit VoteCast(_proposalId, msg.sender, _support, weight);
    }

    /**
     * @dev Execute proposal if passed
     */
    function executeProposal(uint256 _proposalId) external {
        Proposal storage proposal = proposals[_proposalId];

        require(block.timestamp >= proposal.endTime, "Voting not ended");
        require(!proposal.executed, "Already executed");
        require(
            _proposalId > 0 && _proposalId <= proposalCount,
            "Invalid proposal"
        );

        uint256 totalVotes = proposal.votesFor + proposal.votesAgainst;
        require(totalVotes >= minQuorum, "Quorum not reached");

        proposal.executed = true;
        bool approved = proposal.votesFor > proposal.votesAgainst;

        emit ProposalExecuted(_proposalId, approved);
    }

    /**
     * @dev Set voting power for an address
     */
    function setVotingPower(address _voter, uint256 _power) external {
        votingPower[_voter] = _power;
    }

    /**
     * @dev Get proposal details
     */
    function getProposal(
        uint256 _proposalId
    )
        external
        view
        returns (
            uint256 id,
            uint256 signalId,
            string memory description,
            uint256 votesFor,
            uint256 votesAgainst,
            uint256 endTime,
            bool executed
        )
    {
        Proposal storage p = proposals[_proposalId];
        return (
            p.id,
            p.signalId,
            p.description,
            p.votesFor,
            p.votesAgainst,
            p.endTime,
            p.executed
        );
    }

    /**
     * @dev Check if address has voted
     */
    function hasVoted(
        uint256 _proposalId,
        address _voter
    ) external view returns (bool) {
        return proposals[_proposalId].hasVoted[_voter];
    }
}

contracts/RewardToken.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/**
 * @title RewardToken (ERC20)
 * @dev Reward token for community contributors
 */
contract RewardToken {
    string public name = "AI Signal Reward Token";
    string public symbol = "ASRT";
    uint8 public decimals = 18;
    uint256 public totalSupply;

    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;
    mapping(address => bool) public isMinter;

    address public owner;

    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(
        address indexed owner,
        address indexed spender,
        uint256 value
    );
    event Mint(address indexed to, uint256 amount);
    event Burn(address indexed from, uint256 amount);
    event MinterAdded(address indexed minter);
    event MinterRemoved(address indexed minter);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not owner");
        _;
    }

    modifier onlyMinter() {
        require(isMinter[msg.sender] || msg.sender == owner, "Not minter");
        _;
    }

    constructor(uint256 _initialSupply) {
        owner = msg.sender;
        isMinter[msg.sender] = true;
        _mint(msg.sender, _initialSupply * 10 ** decimals);
    }

    /**
     * @dev Transfer tokens
     */
    function transfer(
        address _to,
        uint256 _value
    ) public returns (bool success) {
        require(balanceOf[msg.sender] >= _value, "Insufficient balance");
        require(_to != address(0), "Invalid address");

        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;

        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    /**
     * @dev Approve spender
     */
    function approve(
        address _spender,
        uint256 _value
    ) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        emit Approval(msg.sender, _spender, _value);
        return true;
    }

    /**
     * @dev Transfer from
     */
    function transferFrom(
        address _from,
        address _to,
        uint256 _value
    ) public returns (bool success) {
        require(_value <= balanceOf[_from], "Insufficient balance");
        require(_value <= allowance[_from][msg.sender], "Allowance exceeded");

        balanceOf[_from] -= _value;
        balanceOf[_to] += _value;
        allowance[_from][msg.sender] -= _value;

        emit Transfer(_from, _to, _value);
        return true;
    }

    /**
     * @dev Mint new tokens (only minter)
     */
    function mint(
        address _to,
        uint256 _amount
    ) external onlyMinter returns (bool) {
        _mint(_to, _amount);
        return true;
    }

    /**
     * @dev Internal mint function
     */
    function _mint(address _to, uint256 _amount) internal {
        require(_to != address(0), "Invalid address");

        totalSupply += _amount;
        balanceOf[_to] += _amount;

        emit Mint(_to, _amount);
        emit Transfer(address(0), _to, _amount);
    }

    /**
     * @dev Burn tokens
     */
    function burn(uint256 _amount) external returns (bool) {
        require(balanceOf[msg.sender] >= _amount, "Insufficient balance");

        balanceOf[msg.sender] -= _amount;
        totalSupply -= _amount;

        emit Burn(msg.sender, _amount);
        emit Transfer(msg.sender, address(0), _amount);
        return true;
    }

    /**
     * @dev Add minter
     */
    function addMinter(address _minter) external onlyOwner {
        isMinter[_minter] = true;
        emit MinterAdded(_minter);
    }

    /**
     * @dev Remove minter
     */
    function removeMinter(address _minter) external onlyOwner {
        isMinter[_minter] = false;
        emit MinterRemoved(_minter);
    }

    /**
     * @dev Transfer ownership
     */
    function transferOwnership(address _newOwner) external onlyOwner {
        require(_newOwner != address(0), "Invalid address");
        owner = _newOwner;
    }
}

